import React from "react";

export default function IconCard({ icon, label, onClick }) {
  return (
    <div
      onClick={onClick}
      className="flex flex-col items-center justify-center bg-white/10 hover:bg-white/20 transition rounded-2xl p-4 cursor-pointer text-center"
    >
      <span className="text-3xl">{icon}</span>
      <p className="mt-2 text-sm font-medium">{label}</p>
    </div>
  );
}
